import React from "react";
import { Card } from "react-bootstrap";

const ObjectCard = ({ identifier }) => {
  // Здесь вы можете использовать идентификатор для получения информации об объекте с сервера или из других источников данных

  return (
    <Card border="secondary" style={{ margin: 10 }}>
      <Card.Body>
        <Card.Title>Информация об объекте с идентификатором {identifier}</Card.Title>
        {/* Здесь вы можете отобразить дополнительную информацию об объекте */}
      </Card.Body>
    </Card>
  );
};

export default ObjectCard;
